export const getStaticProps: GetStaticProps = async context => {
  const apolloClient = initializeApollo();
  await apolloClient.query({
    query: searchQuery,
    variables: {
      first: 10
    }
  });
  console.log(context);

  return {
    props: {
      initialApolloState: apolloClient.cache.extract()
    },
    revalidate: 1
  };
};

export default Search;
